import React, { useState } from 'react';
import './Collection.css';

const Collection = () => {
    const [searchQuery, setSearchQuery] = useState(''); // Initialize searchQuery
    const [calendarOpen, setCalendarOpen] = useState(false); // Initialize calendarOpen

    const handleSearchChange = (event) => {
        setSearchQuery(event.target.value);
    };

    const toggleCalendar = () => {
        setCalendarOpen((prev) => !prev);
    };

    return (
        <div className="collection">
            <h1>Collection</h1>
            <div className="filter-bar">
                <button onClick={toggleCalendar}>Toggle Calendar</button>
                <input
                    type="text"
                    placeholder="Search gowns..."
                    value={searchQuery}
                    onChange={handleSearchChange}
                />
            </div>
            {/* Add the rest of your component design here */}
        </div>
    );
};

export default Collection;
